from typing import List

def product_except_self(nums: List[int]) -> List[int]:

    N = len(nums)
    L, R, output = [0]*N, [0]*N, [0]*N

    L[0] = 1
    for i in range(1, N):
        L[i] = nums[i - 1] * L[i - 1]

    R[N - 1] = 1
    for i in reversed(range(N - 1)):
        R[i] = nums[i + 1] * R[i + 1]

    for i in range(N):
        output[i] = L[i] * R[i]

    return output
